import '../styles/Home.css';

function Home() {
    function handleConsultationClick() {
        const expect = document.getElementById('expect');
        expect.textContent = "Our clinic offers personalized consultations with our experienced doctors. We will work with you to develop a treatment plan that meets your unique health needs.";
      }

      document.getElementById('consultationApt').addEventListener('click', handleConsultationClick);

